pragma solidity ^0.4.2;
import "./DappToken.sol";

contract DappTokenSale {
    address admin;
    
    DappToken public tokenContract;

    uint public tokenPrice;
    uint public tokenSold;
    uint public tokenLeft;
    
    event Sell (address buyer, uint _amount);
    
    constructor (DappToken _tokenContract, uint _tokenPrice) public {
        admin = msg.sender;
        tokenContract = _tokenContract;
        tokenPrice = _tokenPrice;
    }
    function multiply (uint x, uint y) internal pure returns (uint z) {
        require(y == 0 || (z = x * y) / y == x, "Errors");
    }

    function buyTokens (uint _numberOfTokens) public payable {
        require(msg.value == multiply(tokenPrice, _numberOfTokens), "1 Blochacoin = 0.001ETH");
        require(tokenContract.balanceOf(this) >= _numberOfTokens,  "Not enough money in this contract");
        require(tokenContract.transfer(msg.sender, _numberOfTokens), "Should transfer the money");
        tokenSold += _numberOfTokens;
        emit Sell (msg.sender, _numberOfTokens);
    }
    function endSale() public {
        require(msg.sender == admin, "Only the admin can use this");
        require(tokenContract.transfer(admin, tokenContract.balanceOf(this)), "Only admin can use this");
        
        selfdestruct(admin);
    }
}
